  [],\n\t\"revision_timestamp\": \"2016-07-27T23:05:07.117377\",\n\t\"name\": \"a-water-budget-and-water-quality-study-of-the-dismal-swamp-thesis-proposal\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The main objective of this project is to
  determine the change in water quality throughout a section of the Dismal Swamp and
  to calculate the water budget for the entire swamp. The objectives of this are:
  1) To analyze and monitor the chemical quality of the surface and ground water of
  the Dismal Swamp and the Suffolk Scarp, using the designated field area. A biannual
  study will involve the sampling of 50 sites and the analysis of the major cations
  and anions of the well, canal, lake, surface and stream water; 2) To see if there
  are distinct water regimes determined by water chemistry and sample location. An
  attempt will be made to determine the change in water chemistry as the water flows
  east ward off the Suffolk Scarp into Lake Drummond and to determine any mixing which
  occurs from the groundwater seepage; and 3) To construct a general water budget
  for the entire Dismal Swamp using available hydrological, meteorological and biological
  data. This will include a determination of the total quantity of water moving in
  to and out of the system.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
